function HomePage() {
    const data = getChatSource();
    return (<div>
        <div>
        	<span>&gt;</span>
        	<img src='https://static.it1352.com/Content/img/login_register.png' alt=""/>
        </div>
        {
            data.map((item, index) => <div key={index.toString()}>{item.msg}</div>)
        }
    </div>);
}

export default HomePage;
